import Discover from '@/pages/discover'
import My from '@/pages/my'
import Friend from '@/pages/friend'

const routes = [
  {
    path: '/discover',
    component: Discover,
    routes: [
      {
        path: '/discover/recommend',
        component: Recommend,
      },
      {
        path: '/discover/ranking',
        component: Ranking,
      },
      {
        path: '/discover/playlist',
        component: Playlist,
      },
      {
        path: '/discover/radio',
        component: Radio,
      },
      {
        path: '/discover/singer',
        component: Singer,
      },
      {
        path: '/discover/album',
        component: Album,
      },
    ]
  },
  {
    path: '/my',
    component: My
  },
  {
    path: '/friend',
    component: Friend
  }

];

export default routes;
